  `photo_2_description` varchar(250) DEFAULT NULL,
  `include_photo` varchar(3) NOT NULL,
  `include_photo_office` varchar(3) NOT NULL,
  `include_photo_web_print` varchar(3) NOT NULL,
  `emb_src_own` varchar(3) NOT NULL,
  `emb_src_own_pi_1` varchar(10) DEFAULT NULL,
  `emb_src_own_pi_2` varchar(10) NOT NULL,
  `emb_src_donor_sperm` varchar(10) DEFAULT NULL,
  `emb_src_donor_sperm_pi_1` varchar(10) DEFAULT NULL,
