  `emb_src_donor_eggs_pi_2` varchar(10) DEFAULT NULL,
  `emb_src_mixture` varchar(10) DEFAULT NULL,
  `emb_src_mixture_pi_1` varchar(10) DEFAULT NULL,
  `emb_src_mixture_pi_2` varchar(10) DEFAULT NULL,
