  `agree_blood_re_test_pi_2` varchar(4) NOT NULL,
  `past_embryo_donor` varchar(1250) NOT NULL,
  `other_facilities` text NOT NULL,
  `best_qualities` text NOT NULL,
  `srms_comments` text NOT NULL,
  `say_to_recipient` text NOT NULL,
  `information_true_accurate` int NOT NULL,
  `signed_name_husband` varchar(200) NOT NULL,
  `signed_name_wife` varchar(200) NOT NULL,
  `signed_date` varchar(15) NOT NULL,
  `other_limiting_stipulations` text NOT NULL,
  `on_reserve` int UNSIGNED NOT NULL DEFAULT '0',
  `is_active` tinyint NOT NULL,
  `category` varchar(30) DEFAULT NULL,
  `mhp_option` varchar(4) NOT NULL,
  `ptp_idp_option` varchar(4) NOT NULL,
  `mhp_donor_info` varchar(15) NOT NULL,
  `donor_single_name` varchar(150) NOT NULL,
