  `embryos_where_created` varchar(100) DEFAULT NULL,
  `embryos_multiple_storage_facilities` varchar(3) DEFAULT NULL,
  `embryos_where_stored` varchar(100) DEFAULT NULL,
  `embryos_how_many_stored` int DEFAULT NULL,
  `embryos_residual_storage_fees` varchar(3) DEFAULT NULL,
  `emb_charity` text NOT NULL,
  `user_id` int NOT NULL,
  `datetime_modified` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `medical_staff_comments` text,
  `medical_director_comments` text,
  `dr_review_datetime` text,
  `is_archive` int UNSIGNED NOT NULL DEFAULT '0',
