  `id` int NOT NULL AUTO_INCREMENT,
  `application_id` int DEFAULT NULL,
  `full_name` varchar(100) DEFAULT NULL,
  `partner_full_name` varchar(100) NOT NULL,
  `address` varchar(200) DEFAULT NULL,
  `city` varchar(200) DEFAULT NULL,
  `state` varchar(200) DEFAULT NULL,
  `zip` varchar(200) DEFAULT NULL,
  `home_phone` varchar(200) DEFAULT NULL,
  `home_phone_contact` varchar(3) DEFAULT NULL,
  `business_phone` varchar(200) DEFAULT NULL,
  `business_phone_contact` varchar(3) DEFAULT NULL,
  `cell_phone` varchar(200) DEFAULT NULL,
  `cell_phone_contact` varchar(3) DEFAULT NULL,
  `pager` varchar(200) DEFAULT NULL,
  `pager_contact` varchar(3) DEFAULT NULL,
  `email` varchar(200) DEFAULT NULL,
  `email_contact` varchar(3) DEFAULT NULL,
  `social_security` varchar(200) DEFAULT NULL,
  `how_i_heard` varchar(255) DEFAULT NULL,
  `country` varchar(255) NOT NULL DEFAULT 'United states',
  `serialized_data` longtext COMMENT '(DC2Type:array)',
  PRIMARY KEY (`id`),
  UNIQUE KEY `UNIQ_CA79F02C3E030ACD` (`application_id`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

